import React from 'react';
import './app.css';

const SplitwiseInfo = () => {
  // Replace this with your Splitwise information
  const splitwiseData = {
    totalAmount: 500,
    yourShare: 200,
    friendShare: 300,
  };

  return (
    <div>
      <h2>Splitwise Information</h2>
      <p>Total Amount: ${splitwiseData.totalAmount}</p>
      <p>Your Share: ${splitwiseData.yourShare}</p>
      <p>Friend's Share: ${splitwiseData.friendShare}</p>
    </div>
  );
};

const LoginRegisterButtons = () => {
  return (
    <div>
      <button onClick={() => alert('Login clicked')}>Login</button>
      <button onClick={() => alert('Register clicked')}>Register</button>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Splitwise Page</h1>
        <SplitwiseInfo />
        <LoginRegisterButtons />
      </header>
    </div>
  );
}

export default App;
